import React from 'react'

const Cards = () => {
  return (
    <div className='flex flex-wrap justify-between p-3 mt-2'>
        <div className='card font-medium shadow-lg p-2 hover:-translate-y-2 cursor-pointer'>
         <img className='h-72' src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8Q9JG-WptxaThfsQ-
         gJtetMMKCctHCn4862wLDE5NPa0W_-m7VbGiDAEFJZiRFs-LAA0&usqp=CAU'/>
        <h1><span className='text-blue-500'>Name:</span> Ratsasan</h1>
        <h1><span className='text-blue-500'>Rating:</span> 5</h1>
        <h1><span className='text-blue-500'>Year:</span> 2022</h1>
        </div>
        
        </div>
  )
  }

export default Cards;
